import React from 'react';
import { useLocation } from 'react-router-dom';

const ConfirmationScreen = () => {
  const location = useLocation();
  const { selectedService, date, time, name, email, contactNumber } = location.state;

  const handlePaymentClick = () => {
    const bookingDetails = {
      selectedService,
      date,
      time,
      name,
      email,
      contactNumber,
    };
    navigate("/confirmation", { state: bookingDetails });
  };

  return (
    <div>
      <h1 className="fs-700 ff-serif text-center">Booking Confirmation</h1>
      <div className="container">
        <h2 className="fs-600 ff-serif">Booking Details</h2>
        <p>Service: {selectedService}</p>
        <p>Date: {date}</p>
        <p>Time: {time}</p>
        <p>Name: {name}</p>
        <p>Email: {email}</p>
        <p>Contact Number: {contactNumber}</p>
      </div>

      <div className="container text-center">
          <button className="btn btn-primary-clr" onClick={handlePaymentClick}>
            Proceed to payment
          </button>
        </div>
    </div>
  );
};

export default ConfirmationScreen;
